import React from 'react'
import {FaGithub} from 'react-icons/fa'
import {Link} from 'react-router-dom'
import PropTypes from 'prop-types'

function Navbar({title}) {
  return (
    <div className='navbar mb-12 shadow-lg bg-neutral text-neutral-content'> //mb-12 is margin-bottom shadow-lg is shadow bg-neutral is background color text-neutral-content is text color
     <div className='container mx-auto'> //container is margin auto 
       <div className='flex-none px-2 mx-2'> //flex-none is flexbox px-2 is padding x-axis mx-2 is margin x-axis
            <FaGithub className='inline pr-2 text-3xl'/> //inline is display pr-2 is padding right text-3xl is text size
            <Link to='/' className='text-lg font-bold'>{title}</Link> //Link to is link to the home page text-lg is text size font-bold is font weight
        </div>
     </div>  
    </div>
  )
}

Navbar.defaultProps = {
  title: 'Github Finder',
}

Navbar.propTypes = {
  title: PropTypes.string,
}
export default Navbar
